import { Component } from "react";

import PageName from "../../shared/pagename/PageName";
import { VerticalLogo } from "../../shared/logo/Logos";
import FormMessage from "../../shared/formmessage/FormMessage";
import RegisterForm from "./RegisterForm/RegisterForm";

import "./RegisterPage.css"

class RegisterPage extends Component{
    
    render(){
        return(
            <div className = "register-page" >
                <div className = "title">
                    <PageName name = "Register" key = "register-page-name"/>    
                </div>
                <div className = "content">
                    <VerticalLogo key = "register-page-logo"/>
                    <FormMessage type="error" message="User either phone or email" key = "register-page-alert-message"/>
                    <RegisterForm key = "register-page-form" />
                    <a href="./../LoginPage" key = "register-page-link" className="fs-3 fw-bold link-secondary">{'>>'} Login {'<<'}</a>
                </div>
            </div>
        )    
    }
}

export default RegisterPage
